import React from 'react';
import './Electry.css';
import Header from './Header.js';
import Footer from './Footer.js';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

class About extends React.Component {
  goAbout = () => {
    this.props.history.push("/about");
  }
  goHome = () => {
    this.props.history.push("/");
  }
  render() {
    return (
      <div class="electry">
        <Header goToHome={this.goHome} goToAbout={this.goAbout} page={""}/>
        <div class="electry-banner">
          <img class="electry-img" src="https://i.ibb.co/vcgb7Td/electry.png" />
        </div>
        <section className="electry-section1">
          <div>Iterative Design of Electry (a YC '20 startup)</div>
          <div>Electry is pitched as “LinkedIn for skilled blue-collar workers.”</div>
          <div>We iteratively designed Electry's web interface, beginning with low-fi designs and culminating in user testing.</div>
          <div>We chose Electry, because we liked the idea of exploring a familiar problem — finding employment — in a different industry — blue-collar work.</div>
          <Container fluid={true}>
          <Row noGutters={true}>
            <Col xs={12} sm={4} md={4}>
              <div>Type</div>
              <p>CS1300 UIUX project</p>
            </Col>
            <Col xs={12} sm={4} md={4}>
              <div>Date</div>
              <p>November 2020</p>
            </Col>
            <Col xs={12} sm={4} md={4}>
              <div>Tools</div>
              <p>Figma, HTML/CSS</p>
            </Col>
          </Row>
        </Container> 
        </section>
        <div className = "footercenter">
          <Footer />
        </div>
      </div>
    );
  }
}

export default About;
